import React, { Fragment } from 'react';

const Index = () => {
  const state = store.getState();
  return (
    <Fragment>
      <div id="cotent">
        <div className="container">
          {state.value}
          <button onClick={() => store.dispatch(increment())} type="button">증가</button>
        </div>
      </div>
      <style jsx>
        {`
        .container {
          height:100px;
          margin: 0 auto;
          width: 1200px;
          overflow:hidden;
        }  
        `}
      </style>
    </Fragment>
  );
};

export default Index;
